@bmwiernik Doesn't #RStats already have a pipebind which can be set to true by 

Sys.setenv(_R_USE_PIPEBIND_ = True )

After that you can pipe it to a lambda function like

Iris |&gt;
 x =&gt; lm( sepal ~ petal, x )

